-- Table structure for tb_car
-- ----------------------------
DROP TABLE IF EXISTS `tb_car`;
CREATE TABLE `tb_car` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `car_type` varchar(255) DEFAULT NULL COMMENT '车型',
  `car_chassis_num` varchar(255) DEFAULT NULL COMMENT '汽车底盘号',
  `license_plate_num` varchar(255) DEFAULT NULL COMMENT '车牌号',
  `car_frame_num` varchar(255) DEFAULT NULL COMMENT '车架号',
  `engine_num` varchar(255) DEFAULT NULL COMMENT '发动机号',
  `warranty_start_miles` decimal(10,2) DEFAULT '0.00' COMMENT '行驶里程',
  `owner_name` varchar(255) DEFAULT NULL COMMENT '客户姓名（车主姓名）',
  `owner_sex` varchar(2) DEFAULT NULL COMMENT '车主性别（0：女 1：男）（暂废除）',
  `owner_city` varchar(10) DEFAULT NULL COMMENT '车主所在城市（关联tb_region）',
  `owner_address` varchar(255) DEFAULT NULL COMMENT '车主详细位置',
  `linker` varchar(255) DEFAULT NULL COMMENT '联系人',
  `linker_mobile` varchar(255) DEFAULT NULL COMMENT '联系电话',
  `owner_fax` varchar(255) DEFAULT NULL COMMENT '车主传真',
  `owner_num` varchar(255) DEFAULT NULL COMMENT '客户编号',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `isdelete` varchar(2) DEFAULT '0' COMMENT '是否删除（0：正常 1：删除）',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=389 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

